const getBrowserFingerprint = async ({
    hardwareOnly = true
} = {}) => {
    const {
        cookieEnabled,
        deviceMemory,
        doNotTrack,
        hardwareConcurrency,
        language,
        languages,
        maxTouchPoints,
        platform,
        userAgent,
        vendor
    } = window.navigator;

    // we use screen info only on mobile, because on desktop the user may use multiple monitors
    const enableScreen = /Mobi|Android|iPhone|iPad|iPod/i.test(navigator.userAgent);

    const {
        width,
        height,
        colorDepth,
        pixelDepth
    } = enableScreen ? window.screen : {}; // undefined will remove this from the stringify down here
    const timezoneOffset = new Date().getTimezoneOffset();
    const timezone = Intl.DateTimeFormat().resolvedOptions().timeZone;
    const touchSupport = "ontouchstart" in window;
    const devicePixelRatio = window.devicePixelRatio;

    const canvas = getCanvasID();
    const audioId = await getAudioID();
    const audioInfo = getAudioInfo();
    const webgl = getWebglID();
    const webglInfo = getWebglInfo();
    const fontsId = getFontsID();

    const data = hardwareOnly ? {
        audioId,
        audioInfo,
        fontsId,
        canvas,
        colorDepth,
        deviceMemory,
        devicePixelRatio,
        hardwareConcurrency,
        height,
        maxTouchPoints,
        pixelDepth,
        platform,
        touchSupport,
        webgl,
        webglInfo,
        width,
    } : {
        audioInfo,
        audio,
        canvas,
        colorDepth,
        cookieEnabled,
        deviceMemory,
        devicePixelRatio,
        doNotTrack,
        hardwareConcurrency,
        height,
        language,
        languages,
        maxTouchPoints,
        pixelDepth,
        platform,
        timezone,
        timezoneOffset,
        touchSupport,
        userAgent,
        vendor,
        webgl,
        webglInfo,
        width,
    };

    const payload = JSON.stringify(data, null, 2);
    const result = murmurhash3_32_gc(payload);
    return result;
};

const getCanvasID = () => {
    try {
        const canvas = document.createElement("canvas");
        const ctx = canvas.getContext("2d");
        const text = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ`~1!2@3#4$5%6^7&8*9(0)-_=+[{]}|;:',<.>/?";
        ctx.textBaseline = "top";
        ctx.font = "14px 'Arial'";
        ctx.textBaseline = "alphabetic";
        ctx.fillStyle = "#f60";
        ctx.fillRect(125, 1, 62, 20);
        ctx.fillStyle = "#069";
        ctx.fillText(text, 2, 15);
        ctx.fillStyle = "rgba(102, 204, 0, 0.7)";
        ctx.fillText(text, 4, 17);

        const result = canvas.toDataURL();

        ctx.clearRect(0, 0, canvas.width, canvas.height);

        return murmurhash3_32_gc(result);
    } catch {
        return null;
    }
};

const getWebglID = () => {
    try {
        const canvas = document.createElement("canvas");
        const ctx = canvas.getContext("webgl");
        canvas.width = 256;
        canvas.height = 128;

        const f =
            "attribute vec2 attrVertex;varying vec2 varyinTexCoordinate;uniform vec2 uniformOffset;void main(){varyinTexCoordinate=attrVertex+uniformOffset;gl_Position=vec4(attrVertex,0,1);}";
        const g = "precision mediump float;varying vec2 varyinTexCoordinate;void main() {gl_FragColor=vec4(varyinTexCoordinate,0,1);}";
        const h = ctx.createBuffer();

        ctx.bindBuffer(ctx.ARRAY_BUFFER, h);

        const i = new Float32Array([-0.2, -0.9, 0, 0.4, -0.26, 0, 0, 0.7321, 0]);

        ctx.bufferData(ctx.ARRAY_BUFFER, i, ctx.STATIC_DRAW);
        h.itemSize = 3;
        h.numItems = 3;

        const j = ctx.createProgram();
        const k = ctx.createShader(ctx.VERTEX_SHADER);

        ctx.shaderSource(k, f);
        ctx.compileShader(k);

        const l = ctx.createShader(ctx.FRAGMENT_SHADER);

        ctx.shaderSource(l, g);
        ctx.compileShader(l);
        ctx.attachShader(j, k);
        ctx.attachShader(j, l);
        ctx.linkProgram(j);
        ctx.useProgram(j);

        j.vertexPosAttrib = ctx.getAttribLocation(j, "attrVertex");
        j.offsetUniform = ctx.getUniformLocation(j, "uniformOffset");

        ctx.enableVertexAttribArray(j.vertexPosArray);
        ctx.vertexAttribPointer(j.vertexPosAttrib, h.itemSize, ctx.FLOAT, !1, 0, 0);
        ctx.uniform2f(j.offsetUniform, 1, 1);
        ctx.drawArrays(ctx.TRIANGLE_STRIP, 0, h.numItems);

        const n = new Uint8Array(canvas.width * canvas.height * 4);
        ctx.readPixels(0, 0, canvas.width, canvas.height, ctx.RGBA, ctx.UNSIGNED_BYTE, n);

        const result = JSON.stringify(n).replace(/,?"[0-9]+":/g, "");

        ctx.clear(ctx.COLOR_BUFFER_BIT | ctx.DEPTH_BUFFER_BIT | ctx.STENCIL_BUFFER_BIT);

        return murmurhash3_32_gc(result);
    } catch {
        return null;
    }
};

const getWebglInfo = () => {
    try {
        const ctx = document.createElement("canvas").getContext("webgl");

        const result = {
            VERSION: String(ctx.getParameter(ctx.VERSION)),
            SHADING_LANGUAGE_VERSION: String(ctx.getParameter(ctx.SHADING_LANGUAGE_VERSION)),
            VENDOR: String(ctx.getParameter(ctx.VENDOR)),
            SUPPORTED_EXTENSIONS: String(ctx.getSupportedExtensions()),
        };

        return result;
    } catch {
        return null;
    }
};

const getAudioInfo = () => {
    try {
        const OfflineAudioContext = window.OfflineAudioContext || window.webkitOfflineAudioContext;
        const length = 44100;
        const sampleRate = 44100;
        const context = new OfflineAudioContext(1, length, sampleRate);

        const result = {
            sampleRate: context.sampleRate,
            channelCount: context.destination.maxChannelCount,
            outputLatency: context.outputLatency,
            state: context.state,
            baseLatency: context.baseLatency,
        };

        return result;
    } catch {
        return null;
    }
};

const getAudioID = async () => {
    try {
        const OfflineAudioContext = window.OfflineAudioContext || window.webkitOfflineAudioContext;
        const sampleRate = 44100;
        const length = 44100; // Number of samples (1 second of audio)
        const context = new OfflineAudioContext(1, length, sampleRate);

        // Create an oscillator to generate sound
        const oscillator = context.createOscillator();
        oscillator.type = "sine";
        oscillator.frequency.value = 440;

        oscillator.connect(context.destination);
        oscillator.start();

        // Render the audio into a buffer
        const renderedBuffer = await context.startRendering();
        const channelData = renderedBuffer.getChannelData(0);

        // Generate fingerprint by summing the absolute values of the audio data
        const result = channelData.reduce((acc, val) => acc + Math.abs(val), 0).toString();

        return murmurhash3_32_gc(result);
    } catch {
        return null;
    }
};

const getFontsID = () => {
    try {
        // Base fonts to compare against
        const baseFonts = ['monospace', 'sans-serif', 'serif'];

        // List of fonts to detect
        const fontsToDetect = [
            // Standard Fonts
            'Arial', 'Arial Black', 'Arial Narrow', 'Calibri', 'Cambria', 'Cambria Math', 'Comic Sans MS',
            'Consolas', 'Courier', 'Courier New', 'Georgia', 'Helvetica', 'Impact', 'Lucida Console',
            'Lucida Sans Unicode', 'Microsoft Sans Serif', 'Palatino', 'Palatino Linotype', 'Segoe UI',
            'Tahoma', 'Times', 'Times New Roman', 'Trebuchet MS', 'Verdana',

            // Additional Windows Fonts
            'Bahnschrift', 'Candara', 'Century Gothic', 'Franklin Gothic', 'Gadugi', 'Garamond',
            'Leelawadee UI', 'MS Gothic', 'MS PGothic', 'MS Sans Serif', 'MS Serif', 'Segoe Print',
            'Segoe Script', 'Segoe UI Light', 'Segoe UI Semibold', 'Symbol', 'Webdings', 'Wingdings',

            // Additional Mac Fonts
            'American Typewriter', 'Andale Mono', 'Apple Chancery', 'AppleGothic', 'AppleMyungjo',
            'Arial Hebrew', 'Arial Rounded MT Bold', 'Avenir', 'Avenir Next', 'Baskerville',
            'Big Caslon', 'Brush Script MT', 'Copperplate', 'Didot', 'Futura', 'Geneva', 'Gill Sans',
            'Helvetica Neue', 'Hoefler Text', 'Lucida Grande', 'Menlo', 'Monaco', 'Optima',
            'Palatino', 'Papyrus', 'Rockwell', 'Skia', 'Zapfino',

            // Popular Web Fonts
            'Roboto', 'Open Sans', 'Lato', 'Montserrat', 'Raleway', 'Ubuntu', 'Noto Sans',
            'Source Sans Pro', 'Poppins', 'Oswald', 'Merriweather', 'Playfair Display',
            'Fira Sans', 'PT Sans', 'Nunito', 'Work Sans', 'Quicksand', 'Rubik'
        ];

        // Create a hidden div for testing
        const testDiv = document.createElement('div');
        testDiv.style.position = 'absolute';
        testDiv.style.left = '-9999px';
        testDiv.style.visibility = 'hidden';
        testDiv.style.fontSize = '72px';
        document.body.appendChild(testDiv);

        const getWidth = (fontFamily) => {
            testDiv.style.fontFamily = fontFamily;
            testDiv.textContent = 'mmmmmmmmmmlli'; // Test string
            return testDiv.offsetWidth;
        };

        const availableFonts = [];

        // Check each font
        fontsToDetect.forEach(font => {
            let detected = false;

            // Compare with each base font
            for (let baseFont of baseFonts) {
                // Get width with the test font first
                const baseWidth = getWidth(`'${font}', ${baseFont}`);
                const fallbackWidth = getWidth(baseFont);

                // If widths are different, the font is available
                if (baseWidth !== fallbackWidth) {
                    detected = true;
                    break;
                }
            }

            if (detected) {
                availableFonts.push(font);
            }
        });

        // Clean up
        document.body.removeChild(testDiv);

        // Sort fonts to ensure consistent ordering before hashing
        availableFonts.sort();
        // Convert array to string and hash it
        return murmurhash3_32_gc(availableFonts.join(','));
    } catch {
        return null;
    }
};

const murmurhash3_32_gc = (key) => {
    const remainder = key.length & 3; // key.length % 4
    const bytes = key.length - remainder;
    const c1 = 0xcc9e2d51;
    const c2 = 0x1b873593;

    let h1;
    let h1b;
    let k1;

    for (let i = 0; i < bytes; i++) {
        k1 = (key.charCodeAt(i) & 0xff) | ((key.charCodeAt(++i) & 0xff) << 8) | ((key.charCodeAt(++i) & 0xff) << 16) | ((key.charCodeAt(++i) & 0xff) << 24);
        ++i;

        k1 = ((k1 & 0xffff) * c1 + ((((k1 >>> 16) * c1) & 0xffff) << 16)) & 0xffffffff;
        k1 = (k1 << 15) | (k1 >>> 17);
        k1 = ((k1 & 0xffff) * c2 + ((((k1 >>> 16) * c2) & 0xffff) << 16)) & 0xffffffff;

        h1 ^= k1;
        h1 = (h1 << 13) | (h1 >>> 19);
        h1b = ((h1 & 0xffff) * 5 + ((((h1 >>> 16) * 5) & 0xffff) << 16)) & 0xffffffff;
        h1 = (h1b & 0xffff) + 0x6b64 + ((((h1b >>> 16) + 0xe654) & 0xffff) << 16);
    }

    const i = bytes - 1;

    k1 = 0;

    switch (remainder) {
        case 3: {
            k1 ^= (key.charCodeAt(i + 2) & 0xff) << 16;
            break;
        }
        case 2: {
            k1 ^= (key.charCodeAt(i + 1) & 0xff) << 8;
            break;
        }
        case 1: {
            k1 ^= key.charCodeAt(i) & 0xff;
            break;
        }
    }

    k1 = ((k1 & 0xffff) * c1 + ((((k1 >>> 16) * c1) & 0xffff) << 16)) & 0xffffffff;
    k1 = (k1 << 15) | (k1 >>> 17);
    k1 = ((k1 & 0xffff) * c2 + ((((k1 >>> 16) * c2) & 0xffff) << 16)) & 0xffffffff;
    h1 ^= k1;

    h1 ^= key.length;

    h1 ^= h1 >>> 16;
    h1 = ((h1 & 0xffff) * 0x85ebca6b + ((((h1 >>> 16) * 0x85ebca6b) & 0xffff) << 16)) & 0xffffffff;
    h1 ^= h1 >>> 13;
    h1 = ((h1 & 0xffff) * 0xc2b2ae35 + ((((h1 >>> 16) * 0xc2b2ae35) & 0xffff) << 16)) & 0xffffffff;
    h1 ^= h1 >>> 16;

    return h1 >>> 0;
};
"
